import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({ props,setQuestions, questions,question,index,category }){

    const upVote = index => {
        const newVote = [...questions];
        newVote[index].upVote++
        setQuestions(newVote);
    };

    console.log();
    return(

        <Paper
            key={index}
        >
            <h3>Category</h3>
            <p>{category}</p>
        </Paper>
    )
}


export default Question;
